import React from "react";
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import { makeStyles } from "@material-ui/core/styles";
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    "& > *": {
      margin: theme.spacing(1)
    },
    "overflow-x": "scroll"
  }
}));

export default function ChampionsButtonGroup() {
  const classes = useStyles();
  navigate(path, { replace: true });

  const Octavos = () => {
    let path = `/champions/round`;
    navigate(path);
  };
  const Cuartos = () => {
    let path = `/mundial/round2`;
    navigate(path);
  };
  const Semis = () => {
    let path = `/mundial/round3`;
    navigate(path);
  };
  const Final = () => {
    let path = `/mundial/round4`;
    navigate(path);
  };
  return (
    <div className={classes.root}>
      <ButtonGroup color="primary" aria-label="outlined primary button group">
        <Button onClick={Octavos}>Octavos</Button>
        <Button onClick={Cuartos} disabled={true}>Cuartos</Button>
        <Button onClick={Semis} disabled={true}>Semis</Button>
        <Button onClick={Final} disabled={true}>Final</Button>
      </ButtonGroup>
    </div>
  );
}
